import logo from "../img/logo2.png";
import sun from "../img/weather-icons/sun.png";
import "../App.css";
import "../styles/WeatherForcast-style.css"
import React, { useState } from "react";
import { Link } from "react-router-dom";
import WeatherAPI from "../scripts/WeatherAPI";
import Layout from "../layout/layout";

function WeatherForcast() {

  return (
    <Layout>
      <section>
        
          <div className="App-panel">
            <h2>Search the wather</h2>
            <form method="GET" onSubmit={handleSubmit}>
              <div class="button r" id="button-3">
                <input
                  type="checkbox"
                  class="checkbox units"
                  name="units"
                  checked={units}
                  onChange={(event) => setUnits(event.target.checked)}
                />
                <div class="knobs"></div>
                <div class="layer"></div>
              </div>
              <input
                type="text"
                name="city"
                id="city"
                placeholder="city"
                value={cityName}
                onChange={(event) => setCityName(event.target.value)}
              />
              <input type="submit" value="Search" />
            </form>
          </div>
        

        <div id="exampleCity">
          <h2>Search the wather</h2>
          <form method="GET" onSubmit={handleSubmit}>
            <div class="button r" id="button-3">
              <input
                type="checkbox"
                class="checkbox units"
                name="units"
                checked={units}
                onChange={(event) => setUnits(event.target.checked)}
              />
              <div class="knobs"></div>
              <div class="layer"></div>
            </div>
            <input
              type="text"
              name="city"
              id="city"
              placeholder="city"
              value={cityName}
              onChange={(event) => setCityName(event.target.value)}
            />
            <input type="submit" value="Search" />
          </form>
        </div>
      </section>
    </Layout>
  );
}

export default WeatherForcast;
